import { useState } from "react";
import "./index.css";

export default function Modal(props) {

  const [veiculo, setVeiculo] = useState('')
  const [ano, setAno] = useState(0)
  const [vendido, setVenido] = useState(false)
  const [descricao, setDescricao] = useState('')

  function handlerSubmit(e){
    e.preventDefault();
  }

  return (
    <div className="maxLayout" style={{
      display: props.open ? 'flex' : 'none'
    }}>
      <div className="modalLayout">
        <h1>Novo Veículo</h1>

        <form action="#" method="GET">
          <div className="rowOne">
            <div className="column">
              <div className="label-input">
                {/* <label htmlFor="veiculo">Veículo</label> */}
                <input 
                  type="text" 
                  id="veiculo" 
                  name="veiculo" 
                  placeholder="Veículo" 
                  value={veiculo}
                  onChange={e => setVeiculo(e.target.value)}
                  />
              </div>

              <div className="label-input">
                {/* <label htmlFor="ano">Ano</label> */}
                <input 
                  type="number" 
                  id="ano" 
                  name="ano" 
                  placeholder="Ano" 
                  value={ano}
                  onChange={e => setAno(e.target.value)}
                  />
              </div>
            </div>

            <div className="column">
              <div className="label-input">
                {/* <label htmlFor="marca">Marca</label> */}
                <input 
                  type="text" 
                  id="marca" 
                  name="marc" 
                  placeholder="Marca" />
              </div>

              <div class="toggle">
                <input type="checkbox" id="vendido" name="vendido"/>
                <label htmlFor="vendido"  id="vendidoLabel" ></label>
                <label htmlFor="vendido">
                  Vendido
                </label>
              </div>
            </div>
          </div>

          <div className="label-input">
            <label htmlFor="descricao">Descrição</label>
            <textarea id="descricao"></textarea>
          </div>

          <div className="buttons">
            <button type="submit">ADD</button>
            <button id="sair">FECHAR</button>
          </div>
        </form>
      </div>
    </div>
  );
}
